script: |
  super -f text -I q696.spq | sort > q696.out

inputs:
  - name: q696.spq
    data: |
      SELECT DISTINCT + 94 AS col2 FROM tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab2 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet) AS cor2;
  - name: tab1
  - name: tab2

outputs:
  - name: q696.out
    data: |
      94
